3. **Contribution Proportion:** The relative contribution of each player to the shared earnings (`token_self`/`token_opp`) might influence the perception of fairness.  A responder who contributed more might have a lower acceptance threshold.

4. **Risk aversion:** Responders may exhibit some level of risk aversion.  While not explicitly measured, the inherent binary choice (accept/reject) incorporates this factor. A risk-averse player would accept less certain gains than a risk-neutral one.

