def simulate_model(trial_data, fairness_weight=1, self_interest_weight=1, contribution_weight=1):
    model_predictions = []
    for trial in trial_data:
        splitperc_self = trial.get("splitperc_self", 0) / 100.0  # Ensure it's a proportion
        split_self = trial.get("split_self", 0)
        token_self = trial.get("token_self", 0)
        token_opp = trial.get("token_opp", 0)

        #Handle edge case of both contribution values being 0
        if (token_self + token_opp) == 0:
            contribution_proportion = 0.5 #default to .5
        else:
            contribution_proportion = token_self / (token_self + token_opp)

        utility = fairness_weight * (0.5 - abs(splitperc_self - 0.5)) + self_interest_weight * split_self + contribution_weight * contribution_proportion

        try:
            p_accept = 1 / (1 + math.exp(-utility))
        except OverflowError:
            p_accept = 0.0 if utility < 0 else 1.0  # Handle potential overflow

        model_predictions.append(p_accept)
    return model_predictions
